import { SEARCH_ACTION, UPDATE_TEXT, ADD_ACTION, FilterAction } from "./types";

export function updateText(text: string): FilterAction {
    return {
        type: UPDATE_TEXT,
        payload: text
    }
}

export function searchAction(): FilterAction {
    return {
        type: SEARCH_ACTION,
    }
}

export function addAction(): FilterAction {
    return {
        type: ADD_ACTION
    }
}
